import React from "react";
import myTime from "../timeline";

function TimelineList() {
  console.log;
  return (
    <div>
      <h1>{myTime.year}</h1>
      <img width="200px" src={myTime.image} alt="event" />
      <p>{myTime.event}</p>
    </div>
  );
}

export default TimelineList;
